import React, { Component } from 'react';
// import Select, { components } from 'react-select';
// import Dropdown from 'react-dropdown';


class Main extends Component {
    // constructor(props){
    //     super(props);
    // }
    showdata=()=>{
       var testobj=localStorage.getItem('data');
       console.log("IS THIS REAL LIFE")
       console.log(JSON.parse(testobj));
       console.log(JSON.stringify(JSON.parse(testobj)))
    }

    render() {
        return (
            <div>
                <h1>The Team:</h1>
                <p>Aristotelis Sibetheros</p>
                <p>Vikcy Xefteri</p>
                <p>Xristina Bakirtzi</p>
                
                <form onSubmit={this.showdata}>
                    <button className="btn btn-primary" type="submit">
                        ΤΕΣΤ
                    </button>
                </form>
            </div>
        );
    }
    
}

export default Main;
